import { 
    VStack, 
    HStack,
    Avatar,
    AvatarBadge,
    AvatarFallbackText,
    AvatarImage,
    Heading,
    Text,
} from '@gluestack-ui/themed';
import React from 'react';
import { View } from 'react-native';

const Home = () => {
    return (
        <VStack>
            <HStack>
                <Avatar>
                    <AvatarFallbackText>Daniel Pineda</AvatarFallbackText>
                    <AvatarBadge $dark-borderColor="$black" />
                </Avatar>
                <VStack>
                    <Heading size='sm'>Daniel Pineda</Heading>
                    <Text size='sm'>Developer</Text>
                </VStack>
            </HStack>
        </VStack>
    );
};

export default Home;
